<script>function showBlocks(){	$('.tag-disabled').each(function(){
	    var id = $(this).attr('id');
	    if( id && id.lastIndexOf('tag-', 0) === 0){
	        var blockid = id.replace('tag-','type-');
	        
	    	$('.'+blockid).addClass('hidden');
	 	}
	 });
	$('.label-info').each(function(){
	    var id = $(this).attr('id');
	    if( id && id.lastIndexOf('tag-', 0) === 0){
	    var blockid = id.replace('tag-','type-');
	    	
	    	$('.'+blockid).removeClass('hidden');
	 	}
	 });
}</script>
